package day21;
/*
 * 2016_12_01
 * 
 * Process 란 ?
 *  운영체제 내에 실행중인 프로그램을 의미
 *  
 *  *프로그램이란 
 *   하드디스크에 있는 데이터를 RAM에 올려진 시점
 * 
 * Multi - Process 란 ?
 *  두개이상의 프로그램이 두개이상의 CPU에서 실행되는 것을 의미
 * 
 * Multi - Tasking 이란?
 *  하나의 CPU에서 여러개의 프로그램이 실행되는 것 처럼 보이는 것.
 */
public class Day21_01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//throw new NullPointerException();
		
		System.out.print("2\r1");
		System.out.print("\r");
		System.out.print("1");
	}
}
